import json
import pandas as pd
import os
import re

# ------------------------------------------------------------------
# helper functions
# ------------------------------------------------------------------
def dataframe_has_potassium(df):
    """Return True if any column name contains 'potassium' (case-insensitive)."""
    pattern = re.compile(r'potassium', flags=re.IGNORECASE)
    return any(bool(pattern.search(str(col))) for col in df.columns)


def dataframe_has_maltese(df):
    """
    Return True if any cell in an object/string column contains
    'maltese' or 'malta' (case-insensitive).
    """
    malt_pattern = re.compile(r'\b(maltese|malta)\b', flags=re.IGNORECASE)

    for col in df.columns:
        # Work only on object/string columns to save time
        if pd.api.types.is_object_dtype(df[col]):
            try:
                # Convert to string, drop NA, check contains
                if df[col].dropna().astype(str).str.contains(malt_pattern).any():
                    return True
            except Exception:
                # Some columns may fail on str ops (e.g., mixed types); ignore safely
                continue
    return False


def file_contains_both(file_path):
    """
    For a given file, return True if ANY sheet/dataframe within that file
    contains both potassium info and maltese info.
    """
    ext = os.path.splitext(file_path)[1].lower()
    try:
        if ext == ".csv":
            df = pd.read_csv(file_path, low_memory=False)
            return dataframe_has_potassium(df) and dataframe_has_maltese(df)

        elif ext in [".xlsx", ".xls"]:
            xls = pd.ExcelFile(file_path)
            for sheet_name in xls.sheet_names:
                df = pd.read_excel(xls, sheet_name=sheet_name)
                if dataframe_has_potassium(df) and dataframe_has_maltese(df):
                    return True
            return False
        else:
            return False
    except Exception as e:
        # If a file fails to load for any reason, mark as False
        print(f"Warning: could not process {file_path}: {e}")
        return False

# ------------------------------------------------------------------
# check all data sources
# ------------------------------------------------------------------
data_files = {
    "worldcities.csv": "/home/gridsan/elai/Kramabench/data/archeology/input/worldcities.csv",
    "conflict_brecke.csv": "/home/gridsan/elai/Kramabench/data/archeology/input/conflict_brecke.csv",
    "roman_cities.csv": "/home/gridsan/elai/Kramabench/data/archeology/input/roman_cities.csv",
    "climateMeasurements.xlsx": "/home/gridsan/elai/Kramabench/data/archeology/input/climateMeasurements.xlsx",
    "radiocarbon_database_regional.xlsx": "/home/gridsan/elai/Kramabench/data/archeology/input/radiocarbon_database_regional.xlsx",
}

results = {}
for fname, fpath in data_files.items():
    results[fname] = file_contains_both(fpath)

# ------------------------------------------------------------------
# Prepare answers for each subtask
# ------------------------------------------------------------------
answers = {
    "subtask-1": results["worldcities.csv"],
    "subtask-2": results["conflict_brecke.csv"],
    "subtask-3": results["roman_cities.csv"],
    "subtask-4": results["climateMeasurements.xlsx"],
    "subtask-5": results["radiocarbon_database_regional.xlsx"],
    "main-task": [fname for fname, has_both in results.items() if has_both]
}

print(json.dumps(answers, indent=4))

import json
import os
import pandas as pd
from openpyxl import load_workbook

# -----------------------------------------------------------
# Utility functions
# -----------------------------------------------------------
def scan_csv_for_keywords(path, keywords, nrows_sample=500):
    """
    Scan a CSV file for given keywords in column names or first `nrows_sample` rows.
    Returns True if any keyword is found, else False.
    """
    try:
        df = pd.read_csv(path, nrows=nrows_sample, low_memory=False)
    except Exception as e:
        # Try reading with different delimiter if comma fails, or fallback to python engine
        try:
            df = pd.read_csv(path, nrows=nrows_sample, sep=';', engine='python', low_memory=False)
        except Exception:
            print(f"Could not read CSV {path}: {e}")
            return False

    # Check column names
    cols_joined = ' '.join([str(c).lower() for c in df.columns])
    if any(k in cols_joined for k in keywords):
        return True

    # Check data sample
    for col in df.columns:
        # Cast to string and lower
        sample = ' '.join(df[col].astype(str).dropna().head(50).str.lower())
        if any(k in sample for k in keywords):
            return True
    return False


def scan_excel_for_keywords(path, keywords, nrows_sample=500):
    """
    Scan an Excel file (all sheets) for the given keywords.
    """
    try:
        wb = load_workbook(path, read_only=True)
    except Exception as e:
        print(f"Could not read Excel {path}: {e}")
        return False

    for sheet_name in wb.sheetnames:
        try:
            df = pd.read_excel(path, sheet_name=sheet_name, nrows=nrows_sample)
        except Exception:
            # Skip sheet if any issue
            continue

        cols_joined = ' '.join([str(c).lower() for c in df.columns])
        if any(k in cols_joined for k in keywords):
            return True

        for col in df.columns:
            sample = ' '.join(df[col].astype(str).dropna().head(50).str.lower())
            if any(k in sample for k in keywords):
                return True
    return False


# -----------------------------------------------------------
# Paths and keywords
# -----------------------------------------------------------
data_paths = {
    "worldcities.csv": "/home/gridsan/elai/Kramabench/data/archeology/input/worldcities.csv",
    "conflict_brecke.csv": "/home/gridsan/elai/Kramabench/data/archeology/input/conflict_brecke.csv",
    "roman_cities.csv": "/home/gridsan/elai/Kramabench/data/archeology/input/roman_cities.csv",
    "climateMeasurements.xlsx": "/home/gridsan/elai/Kramabench/data/archeology/input/climateMeasurements.xlsx",
    "radiocarbon_database_regional.xlsx": "/home/gridsan/elai/Kramabench/data/archeology/input/radiocarbon_database_regional.xlsx"
}

wet_dry_keywords = ["wet-dry", "wet dry", "wet_dry", "wet / dry", "wet", "dry", "index"]  # broad scan; later we filter by sheet results
maltese_keywords = ["maltese", "malta"]


# -----------------------------------------------------------
# Subtask-1: find files with wet-dry index
# -----------------------------------------------------------
files_with_wet_dry = []
for fname, fpath in data_paths.items():
    if fname.endswith(".csv"):
        found = scan_csv_for_keywords(fpath, wet_dry_keywords)
    else:
        found = scan_excel_for_keywords(fpath, wet_dry_keywords)
    if found:
        files_with_wet_dry.append(fname)

# -----------------------------------------------------------
# Subtask-2: find files with Maltese / Malta information
# -----------------------------------------------------------
files_with_maltese = []
for fname, fpath in data_paths.items():
    if fname.endswith(".csv"):
        found = scan_csv_for_keywords(fpath, maltese_keywords)
    else:
        found = scan_excel_for_keywords(fpath, maltese_keywords)
    if found:
        files_with_maltese.append(fname)

# -----------------------------------------------------------
# Prepare answers
# -----------------------------------------------------------
answers = {
    "subtask-1": files_with_wet_dry,
    "subtask-2": files_with_maltese,
    "main-task": {
        "wet_dry_files": files_with_wet_dry,
        "maltese_files": files_with_maltese
    }
}

print(json.dumps(answers, indent=4))

import json
import pandas as pd
import numpy as np

file_path = "/home/gridsan/elai/Kramabench/data/archeology/input/radiocarbon_database_regional.xlsx"

# --- subtask-1: find calendar-year columns -----------------------------------
calendar_cols_by_sheet = {}

# read all sheet names first
xls = pd.ExcelFile(file_path)
for sheet in xls.sheet_names:
    df = pd.read_excel(file_path, sheet_name=sheet, dtype=str)  # read as str to avoid dtype issues
    # potential calendar columns: look for keywords in column names
    possible_cols = [c for c in df.columns
                     if any(k in c.lower() for k in ["cal", "calendar", "calibrated", "bp", "ad", "bc"])]
    # additionally keep columns that look like 4-digit numbers when sampling
    for c in df.columns:
        if c not in possible_cols:
            sample_vals = df[c].dropna().head(20).astype(str)
            if sample_vals.str.fullmatch(r"-?\d{3,5}").any():
                possible_cols.append(c)
    calendar_cols_by_sheet[sheet] = possible_cols

# --- subtask-2: extract all calendar years -----------------------------------
years = set()
for sheet, cols in calendar_cols_by_sheet.items():
    if not cols:
        continue
    df = pd.read_excel(file_path, sheet_name=sheet, dtype=str)
    for col in cols:
        if col not in df.columns:
            continue
        col_series = df[col].dropna().astype(str)

        # try to split ranges like "1230-1210" or "1230/1220"
        expanded = []
        for val in col_series:
            if any(sep in val for sep in ["-", "–", "/", "\\"]):
                for part in re.split(r"[-–/\\]", val):
                    expanded.append(part)
            else:
                expanded.append(val)

        # keep only those that look numeric
        numeric_vals = []
        for v in expanded:
            v = v.strip()
            if v.startswith("c."):
                v = v[2:].strip()
            # remove "AD"/"BC" suffix/prefix
            v = v.replace("AD", "").replace("BC", "").strip()
            # leading/trailing non-digits
            v = re.sub(r"[^\d\-]", "", v)
            if re.fullmatch(r"-?\d{1,5}", v):
                numeric_vals.append(int(v))

        years.update(numeric_vals)

years_sorted = sorted(years)

# prepare answers for print
answers = {
    "subtask-1": calendar_cols_by_sheet,
    "subtask-2": years_sorted,
    "main-task": years_sorted
}

print(json.dumps(answers, indent=4, default=list))

import json
import pandas as pd
from pathlib import Path

# Helper path map (adjust if the root folder differs)
data_root = Path("/home/gridsan/elai/Kramabench/data/archeology/input")
files = {
    "worldcities.csv": data_root / "worldcities.csv",
    "roman_cities.csv": data_root / "roman_cities.csv"
}

# --- subtask-1: inspect the two candidate files -----------------------------
sample_info = {}
for fname, fpath in files.items():
    try:
        # Read only first 5 rows to avoid memory issues
        df = pd.read_csv(fpath, nrows=5, low_memory=False)
        sample_info[fname] = {
            "columns": df.columns.tolist(),
            "sample_rows": df.head(3).to_dict(orient="records")
        }
    except Exception as e:
        sample_info[fname] = {"error": str(e)}

# Decide which file appears to contain modern-city information
# Heuristic: modern city file is expected to contain country codes like iso2/iso3
modern_city_file = None
for fname, info in sample_info.items():
    cols = info.get("columns", [])
    if any(col.lower() in {"iso2", "iso3", "population"} for col in cols):
        modern_city_file = fname
        break

# Prepare answers
answers = {
    "subtask-1": modern_city_file,      # Which file looks like modern cities
    "main-task": modern_city_file       # Final answer expected by the user
}

# Print JSON answers
print(json.dumps(answers, indent=4))
